import { createApp } from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'

createApp(App).mount('#app')

Vue.use(VueRouter)

const router = new VueRouter({
  routes: [
    {
      path: '/home',
      component: App,
      children: [
        {
          path: 'dashboard',
          component: HomeComponent
        }
      ]
    }
  ]
})

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
